import React from 'react';
import AdminCharts from '../Components/AdminCharts';
import "../Pages/Admin.css";

function ProductReview({ adminProducts, deleteProduct, setSelectedProduct }) {
  return (
    <div className="productReviewBody">
      {adminProducts.map((prod) => (
        <div className="clickProductChart" key={prod.id}>
          <AdminCharts
            imgSrc={prod.thumbnail}
            title={prod.productName}
            price={prod.price}
            desc={prod.description}
            rate={prod.rate}
            brand={prod.brand}
            market={prod.compare}
            category={prod.category}
            subCategory={prod.subCategory}
            stock={prod.stock}
            sales={prod.sales}
            deleteOnClick={() => deleteProduct(prod.id)}
            onEdit={() => setSelectedProduct(prod)} // Set the selected product for editing
          />
        </div>
      ))}
    </div>
  );
}

export default ProductReview
